(6178,	203,	'img_split--right_0_image_split_text',	'<h2>AMG group insurance</h2>\r\n<h5>through are group insurer hannover Re, the third largest reinsurer in the world, access very affordable premium rates. Premiums are deducted directly from your AMG Super Account.</h5>\r\n<h3>AMG Super’s Insurance rollover facility</h3>\r\nAs part of AMG Insurance, when you roll over your client’s super from another fund into AMG Super, Hannover Life Re will automatically match the level of cover previously held with the fund, without underwriting. This cover is provided under AMG Super’s policy and premiums.\r\n\r\n<a href=\"#\"> GET AN INSURANCE QOUTE USING OUR CALCULATOR</a>'),
