(6640,	205,	'threecolumnsection_0_threecolumn_column1',	'<h4>Open an Account</h4>\r\nUsing our application form wizard you can simply enter you client’s details and the wizard will automatically complete all the necessary forms for you. Which you can then print out for the signing by the client.'),
(6641,	205,	'_threecolumnsection_0_threecolumn_column1',	'field_5b42dd0795480'),
(6642,	205,	'threecolumnsection_0_threecolumn_column2',	'<h4>Insurance Premium Calculator</h4>\r\nOur insurance premium calculator makes it easy to provide your clients with a quote for establishing insurance through their AMG Personal Super account.'),
