(6866,	213,	'img_split--left_0_image_split_text',	'<h2 class=\"imgsplit__title\">About AMG</h2>\r\n<div class=\"imgsplit__chunk\">\r\n<h4 class=\"imgsplit__subtitle\">Non Aligned</h4>\r\n<p class=\"imgsplit__text\">Established in 2000 as a joint initiative between DDH Graham Limited and Pension Investments Limited.</p>\r\nAMG is an APRA regulated and compliant retail super platform, non-bank owned or aligned.\r\n\r\n</div>\r\n<div class=\"imgsplit__chunk\">\r\n<h4 class=\"imgsplit__subtitle\">DDH Group</h4>\r\n<p class=\"imgsplit__text\">AMG Super is part of the DDH Graham (DDH) Group. DDH is a funds management and administration company with over $10b funds under administration.</p>\r\n\r\n</div>\r\n<div class=\"imgsplit__chunk\">\r\n<h4 class=\"imgsplit__subtitle\">People</h4>\r\n<p class=\"imgsplit__text\">The AMG Super team and Board have a wealth of experience across the financial services and Superannuation sector, this experienced is focused on the overall vision of providing the best service and product to our members and advisers.</p>\r\n\r\n</div>\r\n<a class=\"imgsplit__link\" href=\"http://localhost/wordpress/?preview_id=7&amp;preview_nonce=83a729f1ef&amp;_thumbnail_id=-1&amp;preview=true\">READ MORE</a>'),
